import React, { useEffect, useState } from 'react';
import { Typography, Card, CardContent } from '@mui/material';

const ActiveUsers = () => {
    const [users, setUsers] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const [debugMessage, setDebugMessage] = useState('Initializing fetch operation...');

    useEffect(() => {
        setDebugMessage('Sending fetch request to /active_users...');
        fetch('http://localhost:3000/active_users') // Adjust this as necessary
            .then(response => {
                setDebugMessage(`Fetch response received, status: ${response.status}`);
                if (!response.ok) {
                    throw new Error(`Network response was not ok: ${response.statusText}`);
                }
                return response.json();
            })
            .then(data => {
                setDebugMessage('Processing fetched data...');
                setUsers(data);
                setLoading(false);
                setDebugMessage('Data loaded successfully. Users are now visible.');
            })
            .catch(err => {
                console.error('Failed to fetch active users:', err);
                setError(`Failed to load data: ${err.message}`);
                setLoading(false);
                setDebugMessage(`Error occurred: ${err.message}`);
            });
    }, []);

    return (
        <div style={{ padding: 20 }}>
            <Typography variant="h4" gutterBottom>Active Users</Typography>
            {loading && <Typography>{debugMessage}</Typography>}
            {error && <Typography color="error">{error}</Typography>}
            {!loading && !error && users.map(user => (
                <Card key={user.user_id} style={{ marginBottom: 8 }}>
                    <CardContent>
                        <Typography variant="h5">{user.name}</Typography>
                        <Typography color="textSecondary">Reviews: {user.review_count}</Typography>
                    </CardContent>
                </Card>
            ))}
            {!users.length && !loading && <Typography>No active users found.</Typography>}
            <Typography color="textSecondary">{debugMessage}</Typography>
        </div>
    );
};

export default ActiveUsers;
